import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <nav>
      <ul>
        <li>Главная</li>
        <li>Авторизация</li>
        <li>Профиль</li>
        <li>Информация</li>
      </ul>
      </nav>
    </div>
  );
}

export default App;
